Company:
Originally established in 1957, we are a second generation family owned and operated business. Incorporated in Massachusetts, the company initially began as a window treatment company with our largest client being the General Dynamics Shipyard located in Quincy, MA. In 1991 Scott Newman, now President/ CEO, joined the business and quickly saw a new opportunity in visual communication boards. In 1994 US Markerboard was born and in 1997 the company went national with a presence on the World Wide Web. In 2000 it was decided that US Markerboard should be a separate corporation and so came Brite Visual Products, Inc. dba:US Markerboard.  We originally began as a two person operation equipped witha two-line telephone and brand new fax machine. We have transformed into a dynamic company with 18 full time employees, the most sophisticated and secure accounting & software system, and a great group of friendly and helpful staff all working toward the same goal...To Surpass the Expectations of Our Customers Every Day. In 20 11 US Markerboard proudly celebrated its 10th Anniversary.  For the past five years, US Markerboard has been selected to Inc Magazines 5000 Fastest Privately Held Companies in the United States.
